export default function Movies() {
  const [backendMovies, setBackendMovies] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/api/movies")
      .then((res) => res.json())
      .then((data) => setBackendMovies(data))
      .catch(() => setError("Failed to fetch movies from server"))
      .finally(() => setLoading(false));
  }, []);

  // Normalize backend movies to match MovieCard fields
  const normalizedBackendMovies = backendMovies.map(m => ({
    id: m._id,
    name: m.title, // backend uses 'title', frontend expects 'name'
    rating: m.rating || '',
    language: m.language || '',
    genre: m.genre || '',
    format: m.format || '',
    image: m.posterUrl || '/placeholder-movie.jpg', // backend uses 'posterUrl'
    videoUrl: m.trailerUrl || '', // backend uses 'trailerUrl'
    duration: m.duration ? (typeof m.duration === 'number' ? `${m.duration} min` : m.duration) : '',
    year: m.year ? m.year.toString() : '',
  }));

  const allMovies = [...moviesData, ...normalizedBackendMovies];

  const uniqueGenres = [...new Set(allMovies.map(m => m.genre))];
  const uniqueLanguages = [...new Set(allMovies.map(m => m.language))];

  const [search, setSearch] = useState('');
  const [genreFilter, setGenreFilter] = useState('');
  const [languageFilter, setLanguageFilter] = useState('');
  const navigate = useNavigate();

  const filteredMovies = useMemo(() => {
    return allMovies.filter(movie => {
      return (
        movie.name && movie.name.toLowerCase().includes(search.toLowerCase()) &&
        (genreFilter === '' || movie.genre === genreFilter) &&
        (languageFilter === '' || movie.language === languageFilter)
      );
    });
  }, [search, genreFilter, languageFilter, allMovies]);

  const handleMovieClick = (movie) => {
    navigate('/booking', { state: { movie } });
  };

  return (
    <div className="movies-container">
      <h1>Movies Zone</h1>
      
      <div className="search-container">
        <input
          type="text"
          placeholder="Search movies..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="search-input"
        />
        
        <select 
          value={genreFilter} 
          onChange={(e) => setGenreFilter(e.target.value)}
          className="filter-select"
        >
          <option value="">All Genres</option>
          {uniqueGenres.map((genre) => (
            <option key={genre} value={genre}>
              {genre}
            </option>
          ))}
        </select>
        
        <select 
          value={languageFilter} 
          onChange={(e) => setLanguageFilter(e.target.value)}
          className="filter-select"
        >
          <option value="">All Languages</option>
          {uniqueLanguages.map((language) => (
            <option key={language} value={language}>
              {language}
            </option>
          ))}
        </select>
      </div>

      {error && (
        <div style={{ color: 'red', textAlign: 'center', padding: '1rem' }}>
          {error}
        </div>
      )}
      {loading ? (
        <div style={{ textAlign: 'center', padding: '2rem', color: 'var(--text-secondary)' }}>
          Loading movies...
        </div>
      ) : (
        <div className="movies-grid">
          {filteredMovies.map((movie, idx) => (
            <MovieCard 
              key={movie.id || movie._id || idx}
              movie={movie}
              onClick={() => handleMovieClick(movie)}
            />
          ))}
        </div>
      )}

      {filteredMovies.length === 0 && (
        <div style={{ textAlign: 'center', padding: '2rem', color: 'var(--text-secondary)' }}>
          No movies found matching your criteria.
        </div>
      )}
    </div>
  );
}
